import "./styles.css"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";


const Navbar = () => {
  return (
    <div className="navbar">
      <div className="navbar-logo">
        <h1>
          TRVL <FontAwesomeIcon icon="fa-solid fa-globe" />;
        </h1>
      </div>
    </div>
  );
};

export default navbar;
